import * as React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import { useEffect } from 'react';
import EditIcon from "@material-ui/icons/Edit";
import Button from "@material-ui/core/Button";
import ReactDOM from 'react-dom';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { TextareaAutosize } from '@mui/base';
import { useState, useRef } from 'react';
import { Header } from '../module';
const columns = [
  { field: 'id', headerName: 'ID', width: 180 },
  { field: 'username', headerName: 'Name',width: 180 },
  { field: 'email',headerName: 'Email',width: 180},
  { field: "edit",headerName: "Edit",width: 200,
    renderCell: () => {
      return (
        <Button variant="contained" color="primary" startIcon={<EditIcon />}>
          Edit
        </Button>
      );
    }
  },
  { field: "delete",headerName: "Delete",width: 200,
    renderCell: () => {
      return (
        <Button variant="contained" color="primary" startIcon={<EditIcon />}>
          Delete
        </Button>
      );
    }
  },
];
const ShowdataTable = () => {
    const [tabledate,setTabledata]= useState([])
    useEffect (() => {
 fetch('http://localhost:3001/users')
   .then((data) =>data.json())
 .then((data) => setTabledata(data))
}, [])
console.log(tabledate)
const Modals = () =>{
    const [open, setOpen] = React.useState(false);
    const [myName, setMyName] = useState();
    const [myEmail, setMyEmail] = useState();
    const [isSubmitted, setSubmitted] = useState(false);
    const [pos, setPos] = useState('');
    const [myText,setText] = useState('');

    const handleClickOpen = () => {
      setOpen(true);
    };
    const handleClose = () => {
      setOpen(false);
      setMyName('');
      setMyEmail('');
      setPos('')
      setSubmitted(false);
    };
    const handleSubmit = () => {
      setOpen(false);
      setSubmitted(true);
    };
    const handleName = (e) => {
      setMyName(e.target.value)
      console.log(" Name is", myName)
    }
    const handleEmail= (e) => {
      setMyEmail(e.target.value);
      console.log("Email is", myEmail);
      ;
    }
    const handleText =(e)=>{
      setText(e.target.value);
      console.log("Text is",myText)
    }


    const handleChange = (e, value) => {
    setPos(e.target.value);
    }


return(
<>
<Header/>
<h1>hello</h1>
<div style={{ height: 300, width: '80%', margin: "50px" }}>
      <DataGrid
        rows={tabledate}
        columns={columns}
        pageSize={3}
      />
      <CreateForm
        title="Task Creation"
        message="Create a new task!"
        trigger="Create Task"
        onSubmit={task => service.create(task)}
        submitText="Create"
        validate={values => {
          const errors = {};
          if (!values.title) {
            errors.title = "Please, provide task's title";
          }

          if (!values.description) {
            errors.description = "Please, provide task's description";
          }

          return errors;
        }}
      />

      <UpdateForm
        title="Task Update Process"
        message="Update task"
        trigger="Update"
        onSubmit={task => service.update(task)}
        submitText="Update"
        validate={values => {
          const errors = {};

          if (!values.id) {
            errors.id = "Please, provide id";
          }

          if (!values.title) {
            errors.title = "Please, provide task's title";
          }

          if (!values.description) {
            errors.description = "Please, provide task's description";
          }

          return errors;
        }}
      />

      <DeleteForm
        title="Task Delete Process"
        message="Are you sure you want to delete the task?"
        trigger="Delete"
        onSubmit={task => service.delete(task)}
        submitText="Delete"
        validate={values => {
          const errors = {};
          if (!values.id) {
            errors.id = "Please, provide id";
          }
          return errors;
        }}
      />
     </div>  
</>
)
}
}
export default ShowdataTable;
